import React from 'react';
import IMessage from '../alias/IMessage';

interface IGroupNotification{
    msg: IMessage;
}

const GroupNotification : React.FC<IGroupNotification> = ({ msg }) => {
    switch(msg.eventId){
        case 6:
        return(
            <div
            style={{
                backgroundColor: "gray",
                color: 'white',
                width: '100%',
                textAlign: "center"
            }}    
            >
            {'Member has been removed!'}
            </div>
        );
        default:
            return <></>    
    }
}

export default GroupNotification;
